  async componentDidMount () {
    const res = await axios.get('https://api.github.com/husers');

    alert(res.data);


  }


  render() {
    return (
      <div className="App">
        <Navbar title = 'Github Finder'/>
        <div className = 'container'>
            <Users /> 
        </div>

      </div>
    );
  }
}

export default App;
